import React from 'react';

class GetWeather extends React.Component{
    render(){
        return(
            <div>
                <div className="col-md-3">
                <input 
                    type="text"
                    name = "city"
                    autoComplete = "off"
                    placeholder = "City"
                />
                </div>

                <div className="col-md-3">
                <input 
                    type="text"
                    name = "Country"
                    autoComplete = "off"
                    placeholder = "Country"
                />
                </div>
                <div>
                    <button className="btn btn-warning"> Get Weather</button>
                </div>
            </div>
        );
    }
}

export default GetWeather;
